import Vue from 'vue';  // Asegúrate de que Vue esté correctamente importado
import Home from './Home.vue';  // Cambia la ruta si es necesario

Vue.config.productionTip = false;

new Vue({
  render: h => h(Home),  // Renderiza el componente Home.vue
}).$mount('#app');
